function Book(props) {
    const { book } = props;

    return (
        <div className="book" key={book.name}>
            <Link to={`/books/${book.name}`}>
                <img src={book.image} alt={book.name} />
            </Link>
            <div className="bookInfo">
                <Link to={`/books/${book.name}`}>
                    <p>{book.name}</p>
                </Link>
                <p>by {book.author}</p>
                <button>Add to Cart</button>
            </div>
        </div>
    );
}

export default Book;
